package com.wiley.gr.ace.authorservices.model.external;

/**
 * @author SarmaKumarap
 *
 */
public class RoleLinkData {
	
	private String rel;
	
	private String href;

	/**
	 * @return
	 */
	public String getRel() {
		return rel;
	}

	/**
	 * @param rel
	 */
	public void setRel(String rel) {
		this.rel = rel;
	}

	/**
	 * @return
	 */
	public String getHref() {
		return href;
	}

	/**
	 * @param href
	 */
	public void setHref(String href) {
		this.href = href;
	}
	
}
